import Head from "next/head";
import Layout from "../component/Layout";

const Favorite = (props) => {
  return (
    <Layout>
      <div>
        <Head>
          <title>Favorites</title>
        </Head>
      </div>
    </Layout>
  );
};

Favorite.getInitialProps = async function () {
  fetch("http://localhost:9000/favorite")
    .then((response) => response.json())
    .then((responseJson) => {
      if (Object.values(responseJson[0]).length > 0) {
        this.handleNewsFeedItemList(responseJson);
      }
    });
};
